// SmallCategoryIDIn applies the In predicate on the "small_category_id" field.
func SmallCategoryIDIn(vs ...int) predicate.KcSmallCategoryAttachment {
	v := make([]interface{}, len(vs))
	for i := range v {
		v[i] = vs[i]
	}
	return predicate.KcSmallCategoryAttachment(func(s *sql.Selector) {
		// if not arguments were provided, append the FALSE constants,
		// since we can't apply "IN ()". This will make this predicate falsy.
		if len(v) == 0 {
			s.Where(sql.False())
			return
		}
		s.Where(sql.In(s.C(FieldSmallCategoryID), v...))
	})
}

